import React, { useState, useEffect } from "react";
import SidebarRow from './SidebarRow';
import EmailIcon from '@material-ui/icons/Email';
import LocalLibraryIcon from '@material-ui/icons/LocalLibrary';
import SpeedIcon from '@material-ui/icons/Speed';
import AdminPanelSettingsIcon from '@mui/icons-material/AdminPanelSettings';
import GroupIcon from '@mui/icons-material/Group';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import SupervisedUserCircleIcon from '@mui/icons-material/SupervisedUserCircle';
import FileOpenIcon from '@mui/icons-material/FileOpen';
// import './builder.css'
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';

function Sidebar() {

    return (
        <div className="sidebar no-print">
            <SidebarRow path="/app/dashboard" Icon={SpeedIcon} title="Dashboard"/>
            <SidebarRow path="/app/accounts/borrowers" Icon={GroupIcon} title="Customers"/>
            <SidebarRow path="/app/accounts/admins" Icon={SupervisedUserCircleIcon} title="Admins"/>
            <SidebarRow path="/app/loans" Icon={AccountBalanceWalletIcon} title="Loans"/>
            <SidebarRow path="/app/account/borrower/create" Icon={PersonAddIcon} title="New Profile"/>
            <SidebarRow path="/app/create-admin" Icon={AdminPanelSettingsIcon} title="Create Admin"/>
            <SidebarRow path="/app/reports" Icon={FileOpenIcon} title="Reports"/>
            <SidebarRow Icon={LocalLibraryIcon} title="User Guide" />

        </div>
    )
}

export default Sidebar
